Bobbi Starr, Kimberly Kane, Allie Haze, Zoe Voss, Rocco Reed, Danny Mountain, Michael Vegas, Mark Davis


After losing the love of her life, Linda (Bobbi Starr) finds herself in need of a new inspiration. Thankfully, her close friends have the &quot;perfect&quot; solution as it just so happens that Linda's lost love was an organ donor. In an effort to ... Full Descriptionfind closure, she seeks out each of the organs' recipients to see the impact &quot;he&quot; had on their lives. Will Linda find what she is looking for? What exactly is she looking for? What will she do if she finds it? Are there more questions than answers? One thing is for sure - this sexy, romantic, light-hearted tale is sure to please lovers of all ages.
